jQuery(function($) {
    var menuSwiper = new Swiper('.swiper-container', {
        pagination: '.pagination',
        loop: true,
        autoplay:6000,
        paginationClickable: true
    });

    $('.arrow-left').on('click', function(e) {
        e.preventDefault()
        menuSwiper.swipePrev()
    });
    $('.arrow-right').on('click', function(e) {
        e.preventDefault()
        menuSwiper.swipeNext()
    });


    var eventSwiper = new Swiper('.e-swiper', {
        pagination: '.pagination-event',
        loop: true,
        paginationClickable: true
    });

    $('.event-arrow-left').on('click', function(e) {
        e.preventDefault();
        eventSwiper.swipePrev();
    });
    $('.event-arrow-right').on('click', function(e) {
        e.preventDefault();
        eventSwiper.swipeNext();
    });

    var feature1Swiper = new Swiper('.fs1', {
        pagination: '.pagination-f1',
        loop: true,
        paginationClickable: true
    });

    $('.arrow-left-f1').on('click', function(e) {
        e.preventDefault()
        feature1Swiper.swipePrev()
    });
    $('.arrow-right-f1').on('click', function(e) {
        e.preventDefault()
        feature1Swiper.swipeNext()
    });

    var feature2Swiper = new Swiper('.fs2', {
        pagination: '.pagination-f2',
        loop: true,
        paginationClickable: true
    });

    $('.arrow-left-f2').on('click', function(e) {
        e.preventDefault()
        feature2Swiper.swipePrev()
    });
    $('.arrow-right-f2').on('click', function(e) {
        e.preventDefault()
        feature2Swiper.swipeNext()
    });

    var fSwiper = new Swiper('.f-swiper', {
        pagination: '.fs-pagination',
        loop: true,
        slidesPerView: 2,
        paginationClickable: true
    });

    $('#myCarousel').carousel({
        interval: 3000
    });

    /* SLIDE ON CLICK */

    $('.carousel-linked-nav > li > a').click(function() {

        // grab href, remove pound sign, convert to number
        var item = Number($(this).attr('href').substring(1));

        // slide to number -1 (account for zero indexing)
        $('#myCarousel').carousel(item - 1);

        // remove current active class
        $('.carousel-linked-nav .active').removeClass('active');

        // add active class to just clicked on item
        $(this).parent().addClass('active');

        // don't follow the link
        return false;
    });

    /* AUTOPLAY NAV HIGHLIGHT */

    // bind 'slid' function
    $('#myCarousel').bind('slid', function() {

        // remove active class
        $('.carousel-linked-nav .active').removeClass('active');

        // get index of currently active item
        var idx = $('#myCarousel .item.active').index();

        // select currently active item and add active class
        $('.carousel-linked-nav li:eq(' + idx + ')').addClass('active');

    });

    $('.masonry-loop').packery({
        itemSelector: '.m-item'
    });

    /*if ($.fn.reflect) {
        $('#preview-coverflow .cover').reflect({opacity:0.5});	// only possible in very specific situations
    }*/

    $('#preview-coverflow').coverflow({
        index:			2,
        density:		2,
        innerOffset:	50,
        innerScale:		.6,
        animateStep:	function(event, cover, offset, isVisible, isMiddle, sin, cos) {
            if (isVisible) {
                if (isMiddle) {
                    $('#preview h1').html($(cover).attr('name'))
                    $(cover).css({
                        'filter':			'none',
                        '-webkit-filter':	'none'
                    });
                } else {
                    var brightness	= 1 + Math.abs(sin),
                        contrast	= 1 - Math.abs(sin),
                        filter		= 'contrast('+contrast+') brightness('+brightness+')';
                    $(cover).css({
                        'filter':			filter,
                        '-webkit-filter':	filter
                    });
                }
            }
        }
    });

});

